            isActive,
            recentlyUsed != null ? recentlyUsed!.millisecondsSinceEpoch : null,
            createdDate != null ? createdDate!.millisecondsSinceEpoch : null,
            favorite,
            isDeleted
          ]);
      if (result! > 0) {
        saveResult = BoolResult(
            success: true,
            successMessage: 'Product id=$id updated successfully');
