          /*_loadedfields!.add('product.plProduct');*/ obj.plProduct = obj
                  .plProduct ??
              await obj.getProduct(
                  loadParents: loadParents /*, loadedFields: _loadedFields*/);
        }
      } // END RELATIONSHIPS PRELOAD

    } else {
      obj = null;
    }
    return obj;
  }

