  Future<BoolResult> recover() async {
    _getIsDeleted = true;
    _buildParameters();
    print('SQFENTITIY: recover Quotation bulk invoked');
    return _obj!._mnQuotation.updateBatch(qparams, {'isDeleted': 0});
  }

